import Link from 'next/link'

const Navbar = () => (
    <div>
        <ul>
            <li><Link href='/'><a>Home</a></Link></li>
            <li><Link href='/0_route'><a>Route</a></Link></li>
        </ul>

        <style jsx>{`
            li {
                color: yellow;
                background-color: black;
            }
        `}</style>
    </div>
)

export default Navbar
